#########################################################################
#   ZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZ   #
#   Z Stepper Settings                                                  #
#   ZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZZ   #
#########################################################################

# #####################################################################
# # Motor-2
# # Z1 Stepper - Rear Center
# #####################################################################
[stepper_z1]
step_pin: PE4
dir_pin: !PE5
enable_pin: !PE3
# Rotation Distance for TR8x8 = 8, TR8x4 = 4, TR8x2 = 2
rotation_distance: 4  
microsteps: 32
full_steps_per_rotation: 200

##  BTT TMC5150T Plus driver settings: https://github.com/bigtreetech/docs/blob/master/docs/EZ5160%20Pro.md ##
##  https://github.com/bigtreetech/docs/blob/master/docs/TMC5160.md https://biqu.equipment/products/ez-driver-ez5160-rgb ##
[tmc5160 stepper_z1]
cs_pin: PG13
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
# spi_bus: spi4
sense_resistor: 0.05
#diag1_pin: P1.29
run_current: 0.83
stealthchop_threshold: 999999

# #####################################################################
# # Motor-4
# # Z0 Stepper - Front Left
# # Endstop connected to DIAG_2
# #####################################################################
[stepper_z]
step_pin: PB8
dir_pin: !PB9
enable_pin: !PB7
# Rotation Distance for TR8x8 = 8, TR8x4 = 4, TR8x2 = 2
rotation_distance: 4   
microsteps: 32
# ### Physical Z-Enstop config ###
# endstop_pin: PF3
# homing_retract_dist: 3
# ####Beacon Config####
endstop_pin: probe:z_virtual_endstop # use beacon as virtual endstop
homing_retract_dist: 0 # beacon needs this to be set to 0
# ####--####
##  Z-position of nozzle (in mm) to z-endstop trigger point relative to print surface (Z0)
##  (+) value = endstop above Z0, (-) value = endstop below
##  Increasing position_endstop brings nozzle closer to the bed
##  After you run Z_ENDSTOP_CALIBRATE, position_endstop will be stored at the very end of your config
#position_endstop: -0.5
## For LDO 300^3 kits use 290, for 250^3 kits use 240
position_max: 281
position_min: -2.5
homing_speed: 10.0 # Leadscrews are slower than 2.4, 10 is a recommended max.
second_homing_speed: 3


##  BTT TMC5150T Plus driver settings: https://github.com/bigtreetech/docs/blob/master/docs/EZ5160%20Pro.md ##
##  https://github.com/bigtreetech/docs/blob/master/docs/TMC5160.md https://biqu.equipment/products/ez-driver-ez5160-rgb ##
[tmc5160 stepper_z]
cs_pin: PG11
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
# spi_bus: spi4
sense_resistor: 0.05
#diag1_pin: P1.29
run_current: 0.83
stealthchop_threshold: 999999

# #####################################################################
# # Motor-6
# # Z2 Stepper - Front Right
# #####################################################################
[stepper_z2]
step_pin: PG15
dir_pin: !PB3
enable_pin: !PD5
# Rotation Distance for TR8x8 = 8, TR8x4 = 4, TR8x2 = 2
rotation_distance: 4 
microsteps: 32
full_steps_per_rotation: 200

##  BTT TMC5150T Plus driver settings: https://github.com/bigtreetech/docs/blob/master/docs/EZ5160%20Pro.md ##
##  https://github.com/bigtreetech/docs/blob/master/docs/TMC5160.md https://biqu.equipment/products/ez-driver-ez5160-rgb ##
[tmc5160 stepper_z2]
cs_pin: PG9
spi_software_miso_pin: PE13     # https://github.com/bigtreetech/Octopus-Max-EZ/issues/5#issuecomment-1869756370
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
# spi_bus: spi4
sense_resistor: 0.05
#diag1_pin: P1.29
run_current: 0.83
stealthchop_threshold: 999999

