# 	Additional Sensors
#####################################################################

[temperature_sensor chamber]
## Chamber Temperature - T1
sensor_type: PT1000
pullup_resistor: 2200
sensor_pin: PC5
min_temp: 0
max_temp: 100
gcode_id: chamber_th

#####################################################################
#   Probe
#####################################################################

[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_23D438774E5737374D202020FF100D3F-if00
x_offset: 0 # update with offset from nozzle on your machine
y_offset: 14.2 # update with offset from nozzle on your machine
mesh_main_direction: x
mesh_runs: 2

[bed_mesh]
speed: 500
horizontal_move_z: 10
##--------------------------------------------------------------------
#	Uncomment for 300mm build
mesh_min: 35, 55
mesh_max: 260,245
zero_reference_position: 150,150 #for use with stock z endstop
##--------------------------------------------------------------------
fade_start: 0.6
fade_end: 10.0
probe_count: 49,49 # Values should be odd, so one point is directly at bed center
algorithm: bicubic

#####################################################################
#   Homing and Gantry Adjustment Routines
#####################################################################

[idle_timeout]
timeout: 1800

[safe_z_home]
##  XY Location of the Z Endstop Switch
##  Update -10,-10 to the XY coordinates of your endstop pin 
##  (such as 157,305) after going through Z Endstop Pin
##  Location Definition step.
# #Physical Z-Endstop config
# home_xy_position: 168,304
# speed:25
# z_hop:10
# beacon config
home_xy_position: 150,154
speed:25
z_hop:3

[z_tilt]
##  Use Z_TILT_ADJUST to level the bed .
##  z_positions: Location of toolhead

##--------------------------------------------------------------------
# Uncomment below for 300mm build
z_positions:
  -50, 18
  150, 348
  348, 18
#test points
points:
  35, 7
  150, 265
  254, 7
# points:
#   30, 5
#   150, 245
#   270, 5
##--------------------------------------------------------------------

speed: 200
horizontal_move_z: 10
retries: 5
retry_tolerance: 0.0075

[board_pins]
aliases:
    # # FPC header, Aliases EXP1 & EXP2 for mini12864
